import{_ as g}from"./plugin-vue_export-helper-c27b6911.js";import{r as a,o as V,c as i,d as A,e as n,a as o,f as r}from"./app-cf3e0051.js";const d={},s=r('<p>启动redis-server的时候，就通过redis.conf配置文件来启动</p><ol><li>配置文件对 unit单位 大小写不敏感</li></ol><img src="data:image/png;base64,"><ol start="2"><li>可以通过包含多个配置文件来组成一个完整的配置文件，就像springboot配置文件里面的spring.profile.active一样</li></ol><img src="data:image/png;base64,"><ol start="3"><li>网络相关</li></ol><p>​ 绑定的ip，默认只能通过本地访问，如果需要外部访问，则需要改为0.0.0.0</p><img src="data:image/png;base64,"><p>​ 是否是保护模式</p><img src="data:image/png;base64,"><p>​ 端口设置</p><img src="data:image/png;base64,"><ol start="3"><li>通用设置 GENERAL</li></ol><p>​ 以守护进程的方式进行运行（后台运行），默认为no，我们在使用时需要改为yes</p><img src="data:image/png;base64,"><p>​ 如果以后台方式运行，我们需要指定一个pid文件</p><img src="data:image/png;base64,"><p>​ 日志级别</p><img src="data:image/png;base64,"><p>​ 打印日志存放的文件名（下方图片红色字是文件名，默认为&quot;&quot;）</p><img src="data:image/png;base64,"><p>​ 默认的数据库数量有16个</p><img src="data:image/png;base64,"><p>​ 是否总是显示logo（Redis运行时的banner图）</p><img src="data:image/png;base64,"><ol start="4"><li>关于快照 SNAPSHOTTING</li></ol><p>​ 持久化，在规定的时间内执行了多少操作，则会持久化到文件 .rdb .aof</p><p>​ 在3600秒内执行了至少一次修改，将会进行持久化操作</p><img src="data:image/png;base64,"><p>​ 持久化如果出错，是否还要继续工作</p><img src="data:image/png;base64,"><p>​ 是否压缩rdb文件，需要消耗一些cpu资源</p><img src="data:image/png;base64,"><p>​ 保存rdb文件的时候，进行对错误的检查校验</p><img src="data:image/png;base64,"><p>​ rdb文件保存目录</p><img src="data:image/png;base64,"><p>5，安全相关 SECURITY</p><p>​ 获取密码，默认为空</p><p>​ config get requirepass</p><p>​ 可以在配置文件中设置密码</p><p>​ requirepass 密码</p><p>​ 也可以用命令行设置密码</p><p>​ config set requirepass 密码</p><p>​ 设置之后需要手动登录，然后才能进行操作</p><p>​ auth 密码</p><p>​</p><p>6，客户端最大连接数量，默认为10000 CLIENTS</p><img src="data:image/png;base64,"><p>7，内存相关</p><p>​ 配置Redis的最大内存</p><img src="data:image/png;base64,"><p>​ 内存达到上限后的处理机制</p><p>​ 1. volatile-lru：只对设置了过期时间的key进行LRU（默认值）</p><p>​ 2. allkeys-lru：删除LRU算法的key</p><p>​ 3. volatile-random：随机删除即将过期的key</p><p>​ 4. allkeys-random：随机删除</p><p>​ 5. volatile-ttl：删除即将过期的</p><p>​ 6. noeviction：永不过期，返回错误</p><img src="data:image/png;base64,"><ol start="8"><li>aof相关 APPEND ONLY MODE</li></ol><p>​ 是否开启aof模式，默认关闭</p><p>​ 默认使用rdb方式持久化，在大部分情况下，rdb方式已经够用了</p><img src="data:image/png;base64,"><p>​ aof方式持久化文件名称</p><img src="data:image/png;base64,"><p>​ 多长时间同步一次</p><img src="data:image/png;base64,"><h2 id="springboot链接虚拟机中的redis" tabindex="-1"><a class="header-anchor" href="#springboot链接虚拟机中的redis" aria-hidden="true">#</a> springboot链接虚拟机中的Redis</h2><p>相关博客：</p>',70),t={href:"https://www.cnblogs.com/invban/p/14187524.html",target:"_blank",rel:"noopener noreferrer"};function B(U,u){const e=a("ExternalLinkIcon");return V(),i("div",null,[s,A("ul",null,[A("li",null,[A("a",t,[n("https://www.cnblogs.com/invban/p/14187524.html"),o(e)])])])])}const p=g(d,[["render",B],["__file","redis.conf详解.html.vue"]]);export{p as default};
